import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const Exit = ({ name, age }) => {
  const navigate = useNavigate();

  useEffect(() => {
    setTimeout(() => {
      navigate('/exit'); // Redirect to '/exit' route after 3 seconds
    }, 5000);
  }, [navigate]);

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div>
        <h1>Your name {NamedNodeMap.v} aged {age} has been added to the student system.</h1>
        <p>You will be redirected to the exit page shortly...</p>
      </div>
    </div>
  );
};

export default Exit;
